import React from "react";

function Footer() {
  return (
    <footer className="bg-light text-center text-lg-start mt-4">
      <div className="text-center p-3">
        © 2025 Mon Restaurant. Tous droits réservés.
      </div>
    </footer>
  );
}

export default Footer;
